          "message": "Add double-to-decimal for FixedDecimal via ry (#1217)\n\n* Add ryu and new_from_f32/new_from_f64 to FixedDecimal\r\n\r\n* Add C++ test for ryu APIs\r\n\r\n* fmt\r\n\r\n* Remove f32 methods\r\n\r\n* Add rounding routine\r\n\r\n* Add DoublePrecision\r\n\r\n* Add DoublePrecision::Magnitude\r\n\r\n* fixes\r\n\r\n* fix\r\n\r\n* fix\r\n\r\n* fix\r\n\r\n* Fix bounds\r\n\r\n* More testcases with scientific notation\r\n\r\n* Add SignificantDigits\r\n\r\n* comments\r\n\r\n* round_digits -> round_trailing_digits\r\n\r\n* Add rounding modes\r\n\r\n* Update utils/fixed_decimal/src/decimal.rs\r\n\r\nCo-authored-by: Shane F. Carr <shane@unicode.org>\r\n\r\n* +todo\r\n\r\n* review\r\n\r\n* more review\r\n\r\n* Add DoublePrecision::Integer\r\n\r\n* Properly round up\r\n\r\n* fmt\r\n\r\n* Update utils/fixed_decimal/src/decimal.rs\r\n\r\nCo-authored-by: Shane F. Carr <shane@unicode.org>\r\n\r\n* fmt\r\n\r\n* fix .0\r\n\r\n* fixes\r\n\r\n* refactor integer types\r\n\r\n* fix\r\n\r\n* Correctly uphold invariant of not having trailing zeroes\r\n\r\n* fmt\r\n\r\n* Handle invariants\r\n\r\n* clippy\r\n\r\n* don't override upper magnitude; test fix\r\n\r\nCo-authored-by: Shane F. Carr <shane@unicode.org>",
